import React from 'react';
import './Header.css';
import { createTheme } from '@mui/material/styles';

const theme = createTheme({
    palette: {
        mode: 'dark',
        primary: {
            main: '#479fdf',
            contrastText: '#c0c0c0',
        },
        secondary: {
            main: '#7e40cb',
        },
        error: {
            main: '#981983',
        },
        text: {
            primary: '#c0c0c0',
        },
        info: {
            main: '#40cbc4',
        },
        warning: {
            main: '#fbc411',
        },
    },
});

function Header() {
    return (
        <header>
            <figure id='logo-img'>
                <img src="logo192.png" alt="Parchment icon with a drawing of an Egyptian-style eye" />
            </figure>
            <h1>Archivist</h1>
            <h2>
                A Character Leveling Companion App<br />
                for Dungeons & Dragons 5th Edition
            </h2>
        </header>
    );
}

export default Header;
